    color: '#FFFFFF',
    backgroundColor: '#FFF345',
    '&:hover': {
      backgroundColor: '#000000',
    },
  }));
  
  const StyledButton = styled(Button)(({ theme }) => ({
    color: '#FFFFFF',
    backgroundColor: '#FFF345',
    '&:hover': {
      backgroundColor: '#000000',
